import React from "react";
import { Link,NavLink } from "react-router-dom";
import "./index2.css";
const Menu = () => {
  return (
    <>
      {/* <a href="/">about</a>
      <a href="/contact">contact</a> */}
      <br />
      {/* <Link activeClassName="link" to="/contact">
        contact
      </Link> */}
      <NavLink activeClassName="link" to="/">
        about
      </NavLink>
      <NavLink activeClassName="linked" to="/contact">contact</NavLink>
    </>
  );
};

export default Menu;
